import { Camara, Canva } from "./components"
import { Routes, Route } from "react-router-dom";
import React from 'react';

const App = () => {
  return (

    <Routes>
      <Route path="/" element={<Canva />} />
      <Route path="client" element={<Camara />} />
    </Routes>
  )
}

export default App
